var SAEaelOffcanvas = function($scope, $) {
	new window.SAOffcanvasContent($scope);
};
jQuery(window).on("elementor/frontend/init", function() {
	elementorFrontend.hooks.addAction(
		"frontend/element_ready/sa_el_offcanvas.default",
		SAEaelOffcanvas
	);
});
